import './About.css';
  function About(props) {
    return (
      <>
        <div className='topography-pattern about'>
            <div className='container-1'>
                <p className="header">Who am I?</p>
                <p>Hi I'm a 22 year old designer and coder living in Boston.</p>
            </div>
            <div className='container-2'></div>
        </div>
        
      </>
    );
  }
  
  export default About;
